if mibBuilder.loadTexts: cjnLrrpOperRowStatus.setDescription("The row status variable, used in accordance to installation and removal conventions for conceptual rows. In the text that follows, the characteristics (i.e., whether readable, settable or both) of each value are indicated in parenthesis. The state that this object transitions to when it is set is based on a determination of whether the read-create objects in the row have been correctly initialized for virtual router operation. A row in which not all of the objects are correctly set is considered `incomplete'. The rowstatus of a currently active row in the cjnLrrpOperTable is also constrained by the operational state of the corresponding virtual router. Prior to setting this object from `active' to a different value, the `cjnLrrpOperAdminState' object must be set to `down', and the `cjnLrrpOperState' object be transitioned to `initialize'. The rowstatus column has six defined values: - `active' (read/set). When this value is read, it indicates that all the read-create objects (in the row) required for virtual router operation have been correctly initialized such that the respective virtual router can be made operational by setting the `cjnLrrpOperAdminState' to `up'. When set to `active', no other objects in the conceptual row, with the exception of `cjnLrrpOperAdminState', can be modified. When set, the agent will transition the value of rowstatus to `notReady' if the row is incomplete. - `notInService' (read/set), which when set, allows the objects in the row to be modified by a management station, thus changing the operational characteristics of the corresponding virtual router. - `notReady' (read). The agent sets the object to this state to indicate that the conceptual row exists, but is lacking initialization of one or more objects required for virtual router operation. - `createAndGo' (set), which is set by a management station wishing to create a new instance of a virtual router and to have its status automatically set to `active', making it available for use by a virtual router. Upon receiving a request to set the rowstatus to this value, the agent transitions the rowstatus to `active' if the other settable objects in the row have been correctly initialized. If the row is incomplete, the agent transitions the state to `notReady'. - `createAndWait' (set), which is set by a management station wishing to create a new instance of a virtual router but not make it available for use. When this value is set, rowstatus transitions to `notInService' if the row has been correctly initialized; if the row is incomplete, rowstatus will become `notReady'. - `destroy' (set), which deletes the conceptual row, and hence, the corresponding instance of a virtual router.")
